// @flow

const API_BASE_URL = 'http://198.211.127.126:3000';
// const API_BASE_URL = 'http://127.0.0.1:3000';
/**
 * Enum with all api endpoints
 * @readonly
 * @enum {string}
 */
export const Endpoints = Object.freeze({
  API_BASE_URL,
});
